/*Now that our table is created we can use "Table Data Import Wizard" function to import data.Make sure data format is same as you have kept in your CREATE TABLE syntax*/

/*After Importing data now we can use select function to extract data from our table*/ 

/*We wil start with basic aggregate functions*/

-- 1. Total Orders
SELECT COUNT(Order_ID) AS Total_Orders
FROM Orders_Details;

-- 2. Total Revenue
SELECT SUM(Total_Price) AS Total_Revenue
FROM Orders_Details;

-- 3. Average Unit Price
SELECT AVG(Unit_Price) AS Avg_Unit_Price
FROM Orders_Details;

-- 4. Top 5 Countries by Orders
SELECT Country, COUNT(Order_ID) AS Total_Orders
FROM Orders_Details
GROUP BY Country
ORDER BY Total_Orders DESC
LIMIT 5;

/*Now moving on towards some intermediate functions like GROUP BY function*/

-- 5. Total revenue per country
SELECT Country, SUM(Total_Price) AS Total_Revenue
FROM Orders_Details
GROUP BY Country;

-- 6. Average review rating per product category
SELECT Product_Category, AVG(Review_Rating) AS Average_Review_Rating
FROM Orders_Details
GROUP BY Product_Category;

-- 7. Orders and revenue per payment method
SELECT Payment_Method, COUNT(Order_ID) AS Total_Orders, SUM(Total_Price) AS Total_Revenue
FROM Orders_Details
GROUP BY Payment_Method;

-- 8. Top 3 products by sales revenue
SELECT Product, SUM(Total_Price) AS Total_Sales_Revenue
FROM Orders_Details
GROUP BY Product
ORDER BY Total_Sales_Revenue DESC
LIMIT 3;

/*In next step more complex queries like Subqueries and CTEs wil be explored*/

-- 9. Orders with Total Price greater than the average order value
SELECT *
FROM Orders_Details
WHERE Total_Price > (
    SELECT AVG(Total_Price)
    FROM Orders_Details
);

-- 10. Products with Unit Price greater than the average Unit Price
SELECT Product, Unit_Price
FROM Orders_Details
WHERE Unit_Price > (
    SELECT AVG(Unit_Price)
    FROM Orders_Details
);

-- 11. Top-selling product by revenue (highest Total_Revenue)
SELECT Product, SUM(Total_Price) AS Total_Revenue
FROM Orders_Details
GROUP BY Product
ORDER BY Total_Revenue DESC
LIMIT 1;

-- 12. Countries with revenue less than the maximum country revenue
SELECT Country, SUM(Total_Price) AS Total_Revenue
FROM Orders_Details
GROUP BY Country
HAVING Total_Revenue < (
    SELECT MAX(Total_Revenue)
    FROM (
        SELECT Country, SUM(Total_Price) AS Total_Revenue
        FROM Orders_Details
        GROUP BY Country
    ) AS X
);

-- 13.Products whose total quantity sold is greater than the average product quantity
SELECT Product, SUM(Quantity) AS total_quantity
FROM Orders_Details
GROUP BY Product
HAVING SUM(Quantity) > (
    SELECT AVG(product_quantity)
    FROM (
        SELECT SUM(Quantity) AS product_quantity
        FROM Orders_Details
        GROUP BY Product
    ) AS X
);

/*Now We will dive a bit into CTEs*/

-- 14. Find orders with Total_Price greater than the average
WITH avg_orders AS (
    SELECT AVG(Total_Price) AS avg_price
    FROM Orders_Details
)
SELECT o.*
FROM Orders_Details o
CROSS JOIN avg_orders
WHERE o.Total_Price > avg_orders.avg_price;

-- 15. Total revenue per product
WITH product_revenue AS (
    SELECT Product, SUM(Total_Price) AS total_revenue
    FROM Orders_Details
    GROUP BY Product
)
SELECT Product, total_revenue
FROM product_revenue;

-- 16. Rank products by revenue
WITH product_sales AS (
    SELECT Product, SUM(Total_Price) AS revenue
    FROM Orders_Details
    GROUP BY Product
)
SELECT Product, revenue,
       RANK() OVER (ORDER BY revenue DESC) AS revenue_rank
FROM product_sales;

-- 17. Order value vs overall average (window function)
SELECT 
    Order_ID,
    Total_Price,
    AVG(Total_Price) OVER () AS avg_order_value
FROM Orders_Details;

